import React, {useEffect} from 'react'
import {useParams } from 'react-router-dom'
import axios from 'axios';

function Post() {
    let { id } = useParams();
    const [reports, setReports] = useState([]);

   
        useEffect(() => {
            axios
              .post("http://localhost:3001/getdatabase/report")
              .then((response) => {
                setReports(response.data);
              });
        
    });

  return <div>{id}</div>;
}

export default Post;
